import './App.css';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";
import Dashboard from './components/dashboard';

function App() {
  return (
    <div className="App">

        <Router>
          <Route path="/app"  component={Dashboard} />
        </Router>

    </div >
  );
}

export default App;
